window.bookSummaryJSON = "<p>A troubled past, a magical future, and a whole lot of adventure!</p> <p>Raised in the slums and alleys of Helsin, Argo is tired of lurking. He is exhausted of living meal to meal and tries to elevate himself to a better life. The Rumi Guild he plans to depart, well, they decide to bury him instead of letting him escape their grip. Argo sees the trap coming, avoids the clutches of fate, and runs from everything he's ever known.</p> <p>While on the trip across the desert to the fabled forests of Larjoon, fortune favors Argo. He becomes something more than he ever anticipated. As a new wizard traveling through an unknown realm, he eagerly becomes a - Mercenary Wizard.</p>"; 
